import Navbar from "../Component/Navbar";
import React, { useEffect, useState } from "react";
import Slayt from "../Component/Slayt";
import Canlı from "../Component/Canlı";

const Home = () => {

    const [takım, SetTakımlar] = useState([])

    useEffect(() => {
        const api_link ="https://cryptic-gorge-72989.herokuapp.com/teams"
        fetch(api_link)
            .then(takım => takım.json())
            .then(takım => {
                SetTakımlar(takım)
            })
    }, [])
    return (
        <div>
            <Navbar />
            <hr />
            <h3 style={{textAlign:"center",fontSize:18}}>Canlı Puan Durumu</h3>
            <Canlı/>
            <h3 style={{textAlign:"center",fontSize:18}}>Süperlig Şampiyonları</h3><br/>
            <Slayt/>
            <div className="">
                {
                    takım.map(takım =>
                        <div>
                            <h1>{takım.name}</h1>
                        </div>
                    )
                }
            </div>
        </div>
    )
}

export default Home;
